import "./header.css";

const Header = () => {
  return (
    <div className="header">
      <div className="header__container">
        <img
          src="https://mobf.org/wp-content/uploads/2020/12/my-own-book-favicion.png"
          alt="logo"
        />
      </div>
      <div className="header__container"></div>
    </div>
  );
};

export default Header;
